var savedDpi1;

var vLedNames = ["Dpi Zone", "Logo Zone"];
var vLedPositions = [
    [0,1],[1,2]
];

export function LedNames()
{
    return vLedNames;
}

export function LedPositions()
{
    return vLedPositions;
}


export function Initialize()
{
    if(DpiControl) {
        setDpi(dpi1);
    
}
}

function setDpi(dpi){

    device.set_endpoint(1, 0x0001, 0xff00); // System IF    
    savedDpi1 = dpi1;

    var packet = [];
    packet[0] = 0x10;
    packet[1] = 0xFF;
    packet[2] = 0x0A;
    packet[3] = 0x3C;
    packet[4] = 0x00;
    packet[5] = Math.floor(dpi/256);
    packet[6] = dpi%256;
    device.write(packet, 7);
}

function Apply()
{
    var packet = [];

    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x02;
    packet[0x03] = 0x3E;

    device.write(packet, 20);  
    //device.pause(30);  
    //device.read(packet,20);
}

function sendZone(zone){
    var packet = [];
    packet[0x00] = 0x11;
    packet[0x01] = 0xFF;
    packet[0x02] = 0x02;
    packet[0x03] = 0x3E;
    packet[0x04] = zone;
    packet[0x05] = 0x01;

    
    
        var iX = vLedPositions[zone][0];
        var iY = vLedPositions[zone][1];
        var color = device.color(iX,iY);
        
        packet[0x06] = color[0];
        packet[0x07] = color[1];
        packet[0x08] = color[2];
    
    
    packet[0x09] = 0x02;

    device.write(packet, 20);
    device.pause(30);
}

export function Render()
{
    device.set_endpoint(1, 0x0002, 0xff00); // Lighting IF    
    sendZone(0);
    //Apply(); //Makes Dpi zone flicker
    sendZone(1);
    //Apply(); //Makes Dpi zone flicker''

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
      }
}



